import './App.css';
import { Route, Routes } from 'react-router';
import Home from './pages/Home';

function App() {
  return (
    <div className="App">
      <h1>Shivam</h1>
      <Route>
        <Route index element={<Home/>}/>
      </Route>
    </div>
  );
}

export default App;
